                    section_five: {
                        paragraph: "No need for scribbly notebooks and Post-its here \u2014 Reframer does all the hard work for you. Use the theme builder to group together and create themes to pull out insights from your findings. Chord diagrams show you relationships between all your tagged observations, allowing you to spot themes at a glance.",
                        title: "Discover themes in hours instead of days"
                    },
                    section_four: {
                        paragraph: "Create an understanding of your customers across stakeholders and business units by getting other team members involved with research. At the end of research sessions, look through the data you and your team captured to make sure it\u2019s in great shape so you can analyze it together.",
                        title: "Get others involved with research"
                    },
                    section_one: {
                        paragraph_four: "Cut to the chase and spot themes in minutes. Get to insights from user tests and interviews quickly through our easy-to-use analysis.",
                        paragraph_one: "Set research objectives with your team and make sure everyone has what they need to get the study underway.",
                        paragraph_three: "Make sure the data that you and your other team members captured is tidy, tagged and ready for analysis.",
                        paragraph_two: "Note down what your participants are thinking, feeling and doing during sessions, or import existing research to analyze later.",
                        title_four: "Make sense of your findings",
                        title_one: "Plan your research",
                        title_three: "Review data from your team",
                        title_two: "Capture information and observations"
                    },
                    section_six: {
                        paragraph: "Keep all your research in one place for better traceability and visibility later. You can import existing research into Reframer to make analysis easy, or export the data you captured in Reframer elsewhere.",
                        title: "Make your research traceable and portable"
                    },
                    section_three: {
                        paragraph: "#Hashtag as you note down observations to make discovering patterns and trends a breeze, or leave that until you review your data later. Use the tag drawer to quickly select from your existing tags. Capture a quote and we\u2019ll automatically tag it for you too.",
                        title: "Tag data to make analysis a piece of cake"
                    },
                    section_two: {
                        paragraph: "It\u2019s easy for you and your notetakers to capture qualitative research observations straight into Reframer during user tests or interviews. With a distraction free environment, you can focus on what\u2019s important \u2014 your participants.",
                        title: "Capture all your research in one place"
                    }
